                        <html><head><meta charset="utf-8"></head><body>
<p>Дегидрированное мясо ягненка и индейки (25%), цельная кукуруза, гидролизованный белок, цельный рис, рыбий жир, куриный жир, сушеная мякоть свеклы, альбумин, дегидратированная и гидролизованная куриная печень, кукурузные рыльца, витаминно-минеральный премикс (витамины: А, Д3, Е, холин хлорид, бетаин, В3, В5, В2, В1, В6, фолиевая кислота, В12, калий, цинк, железо, марганец, медь, йод, селен, таурин), дегидратированное яйцо, дрожжи - источник мананн-олигосахаридов (MOS), яблоки сушеные, DL-метионин, инулин - фруктоолигосахарид (FOS), пробиотик - живые микроорганизмы Bacillus subtilis и Bacillus licheniformis, экстракты фенхеля и розмарина, экстракт Юкки Шидигера, фукус, антиоксидант.</p>
